import React from "react";

const ImageHolder = (props) => {
  return (
    <img
      className={
        "message-image-holder" + (props.image !== "" ? "-displayed" : "")
      }
      src={props.image}
      alt=""
    ></img>
  );
};

export default ImageHolder;
